import { Photo } from './../Model/Photo';
import { CameraOptions } from '@ionic-native/camera';
import firebase from 'firebase'

export class PhotoHelper {

    photos: Photo[] = []
    userName = ''
    camera;
    options: CameraOptions = {};
    constructor(userName, camera) {

        this.camera = camera
        this.userName = userName;
        this.options = {
            quality: 95,
            sourceType: this.camera.PictureSourceType.CAMERA,
            destinationType: this.camera.DestinationType.DATA_URL,
            encodingType: this.camera.EncodingType.JPEG,
            mediaType: this.camera.MediaType.PICTURE,
            saveToPhotoAlbum: true,
            correctOrientation: true,
            targetHeight: 700,
            targetWidth: 700,
            allowEdit: false
        }
    }

    uplaod() {
        let photoPromises = []
        this.photos.forEach(photo => {
            let p = firebase.storage().ref('images/' + this.userName + '/' + photo.name).putString(photo.image, 'base64');
            p.then(snapshot => {
                photo.URL = snapshot.downloadURL
            })
            photoPromises.push(p)
        })
        return Promise.all(photoPromises)

    }



    snap() {
        this.camera.getPicture(this.options).then(data => {
            var photo: Photo = new Photo(data, "" + this.getPhotoName())
            this.photos.push(photo);
        }, (err) => {

            console.log("error: " + err)
            var d = ""

            var photo: Photo = new Photo(d, this.getPhotoName() + "")
            this.photos.push(photo)
        });
    }
    getPhotoName() {
        var date = new Date();
        var newDate = new Date(8 * 60 * 60000 + date.valueOf() + (date.getTimezoneOffset() * 60000));
        var ampm = newDate.getHours() < 12 ? ' AM' : ' PM';
        var strDate = newDate + '';
        return (strDate).substring(0, strDate.indexOf(' GMT')) + ampm + ".jpg"
    }
}